import React, { useState } from 'react';

export default function Login(){
  const [email,setEmail]=useState('');
  const [password,setPassword]=useState('');
  const [err,setErr]=useState('');
  const [openReg,setOpenReg]=useState(false);
  const [reg,setReg]=useState({ name:'', email:'', password:'', role:'user' });
  const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:4000';

  async function handleLogin(e){
    e.preventDefault(); setErr('');
    try{
      const res = await fetch(`${API_URL}/api/auth/login`, {method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({email,password})});
      const json = await res.json(); if(!res.ok) throw new Error(json.message||'Login failed');
      localStorage.setItem('token', json.token); localStorage.setItem('user', JSON.stringify(json.user)); window.location.href='/';
    }catch(e){ setErr(e.message); }
  }

  async function handleRegister(e){
    e.preventDefault(); setErr('');
    try{
      const res = await fetch(`${API_URL}/api/auth/register`, {method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify(reg)});
      const json = await res.json(); if(!res.ok) throw new Error(json.message||'Register failed');
      // התחבר אוטומטי
      localStorage.setItem('token', json.token); localStorage.setItem('user', JSON.stringify(json.user)); window.location.href='/';
    }catch(e){ setErr(e.message); }
  }

  return (
    <div className="min-h-screen flex items-center justify-center p-4">
      <div className="w-full max-w-md bg-white rounded-2xl shadow-lg p-8">
        <div className="flex items-center gap-3 mb-6">
          <img src="/logo.png" alt="Costoro" className="w-10 h-10"/>
          <h1 className="text-2xl font-semibold">Costoro Timewatch</h1>
        </div>

        <form onSubmit={handleLogin} className="space-y-4">
          <div><label className="block text-sm mb-1">אימייל</label>
            <input className="w-full border rounded-xl px-3 py-2 focus:outline-none focus:ring" type="email" value={email} onChange={e=>setEmail(e.target.value)} required/></div>
          <div><label className="block text-sm mb-1">סיסמה</label>
            <input className="w-full border rounded-xl px-3 py-2 focus:outline-none focus:ring" type="password" value={password} onChange={e=>setPassword(e.target.value)} required/></div>
          {err && <div className="text-red-600 text-sm">{err}</div>}
          <button className="w-full bg-black text-white rounded-xl py-2.5 font-medium hover:opacity-90" type="submit">התחברות</button>
        </form>

        <div className="mt-6 text-center">
          <button className="text-sm underline" onClick={()=>setOpenReg(v=>!v)}>
            {openReg ? 'סגור יצירת משתמש' : 'יצירת משתמש חדש'}
          </button>
        </div>

        {openReg && (
          <form onSubmit={handleRegister} className="space-y-3 mt-4 border-t pt-4">
            <div className="font-medium">הרשמה</div>
            <input className="w-full border rounded-xl px-3 py-2" placeholder="שם" value={reg.name} onChange={e=>setReg(v=>({...v,name:e.target.value}))} required/>
            <input className="w-full border rounded-xl px-3 py-2" placeholder="אימייל" type="email" value={reg.email} onChange={e=>setReg(v=>({...v,email:e.target.value}))} required/>
            <input className="w-full border rounded-xl px-3 py-2" placeholder="סיסמה" type="text" value={reg.password} onChange={e=>setReg(v=>({...v,password:e.target.value}))} required/>
            <select className="w-full border rounded-xl px-3 py-2" value={reg.role} onChange={e=>setReg(v=>({...v,role:e.target.value}))}>
              <option value="user">User</option>
              <option value="admin">Admin</option>
            </select>
            <button className="w-full bg-black text-white rounded-xl py-2.5" type="submit">צור משתמש</button>
          </form>
        )}
      </div>
    </div>
  );
}
